// Helpers/todoData.js

const todoData = [
    {
        id: 1,
        content: "manger ses devoirs",
        done: false
    },
    {
        id: 2,
        content: "essuyer sa chambre",
        done: false
    },
    {
        id: 3,
        content: "sortir la vaisselle",
        done: false
    },
    {
        id:4,
        content: "enterrer la voisine",
        done: false
    }
];

export default todoData
